import {useEffect,useState} from 'react'
import './TodoList.css'
import Api from '../../axios/Axios'
import Card from './Card'
const ToDoList = () => {

  const token = sessionStorage.getItem('token');

  const [toDoList,setToDoList] = useState(undefined)

  useEffect(()=>{


    const customConfig = {
      headers: {
      'Content-Type': 'application/json',
      "Authorization" : `Bearer ${token}`
      }
  };


    async function loadToDoList(){
      await Api('/user/todolist' ,customConfig).then((data)=>{
        setToDoList(data.data.data)
      })
    }
    loadToDoList()
  },[])




  return (
    <div className='todolist-box'>
           <div className="box-header">
                <h5>Lista de Tarefas</h5>
                <img src="./../../../img/icons/btnpurper.svg"  />
          </div>
          <div className='todolist-scrol'>
            {toDoList !== undefined ? 
              toDoList.map((item)=>(
                <Card id={item.id} title={item.title} status={item.status} category={item.category} description={item.description}/>

              ))


            :''}

            </div>
    </div>
  )
}

export default ToDoList
